import React, { useState, useEffect } from "react";
import Seats from "../../service/Seats";


const Room = () => {
    const [seatsList, setSeatsList] = useState("")

    useEffect(() =>{
        const response = Seats.getAllSeats();
        setSeatsList(response.data)
    },[])

    return(
        <div>
            {setSeatsList.map(item => (
                <p>
                    {item.id}
                </p>
            ))}
        </div>
    )
}


export default Room
